package javapoint.stream;

public class JavaStreamExample {
    String name;  
    float price;  
    public JavaStreamExample(String name, float price) {  
        this.name = name;  
        this.price = price;  
    } 
    
    @Override
    public String toString() {
    	// TODO Auto-generated method stub
    	return name + " " + price;
    }
}
